import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Step 1: Add an item to the cart to enable quantity updates.
    // Products are loaded dynamically by JavaScript.
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.locator('.add-to-cart').first().click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // Step 2: Open the cart modal by clicking the cart icon.
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_opened.png'));

    // Step 3: Extract the initial quantity of the first item.
    const initialQuantityLocator = page.locator('.cart-item span.quantity').first();
    const initialQuantity = await initialQuantityLocator.textContent();

    // Step 4: Increase the quantity by clicking the '+' button.
    await page.locator('.cart-item button.quantity-btn:has-text("+")').first().click();

    // The DOM re-renders after the click, so we get the new value.
    const finalQuantityLocator = page.locator('.cart-item span.quantity').first();
    const finalQuantity = await finalQuantityLocator.textContent();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_updated.png'));

    // Step 5: Verify the update and prepare return data.
    const extractedData = {
      initialQuantity: initialQuantity,
      finalQuantity: finalQuantity
    };

    const expectedQuantity = parseInt(initialQuantity, 10) + 1;
    if (parseInt(finalQuantity, 10) !== expectedQuantity) {
      throw new Error(`Quantity did not update as expected. Initial: ${initialQuantity}, Final: ${finalQuantity}, Expected: ${expectedQuantity}`);
    }

    return {
      success: true,
      action: `Updated cart item quantity from ${initialQuantity} to ${finalQuantity}.`,
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
